[{"location":"#BaseModelica.jl:-BaseModelica-Importers-for-ModelingToolkit.jl","page":"Home","title":"BaseModelica.jl: BaseModelica Importers for ModelingToolkit.jl","text":"BaseModelica.jl is an interface for the SciML open source software organization for importing BaseModelica, a new standard from the Modelica association for lowered Modelica code. As such, it makes it easy to import Modelica models into ModelingToolkit.","category":"section"},{"location":"#Installation","page":"Home","title":"Installation","text":"To install BaseModelica.jl, use the Julia package manager:\n\nusing Pkg\nPkg.add(\"BaseModelica\")","category":"section"},{"location":"#API","page":"Home","title":"API","text":"","category":"section"},{"location":"#Contributing","page":"Home","title":"Contributing","text":"Please refer to the SciML ColPrac: Contributor's Guide on Collaborative Practices for Community Packages for guidance on PRs, issues, and other matters relating to contributing to SciML.\nSee the SciML Style Guide for common coding practices and other style decisions.\nThere are a few community forums:\nThe #diffeq-bridged and #sciml-bridged channels in the Julia Slack\nThe #diffeq-bridged and #sciml-bridged channels in the Julia Zulip\nOn the Julia Discourse forums\nSee also SciML Community page","category":"section"},{"location":"#Reproducibility","page":"Home","title":"Reproducibility","text":"<details><summary>The documentation of this SciML package was built using these direct dependencies,</summary>\n\nusing Pkg # hide\nPkg.status() # hide\n\n</details>\n\n<details><summary>and using this machine and Julia version.</summary>\n\nusing InteractiveUtils # hide\nversioninfo() # hide\n\n</details>\n\n<details><summary>A more complete overview of all dependencies and their versions is also provided.</summary>\n\nusing Pkg # hide\nPkg.status(; mode = PKGMODE_MANIFEST) # hide\n\n</details>\n\nusing TOML\nusing Markdown\nversion = TOML.parse(read(\"../../Project.toml\", String))[\"version\"]\nname = TOML.parse(read(\"../../Project.toml\", String))[\"name\"]\nlink_manifest = \"https://github.com/SciML/\" * name * \".jl/tree/gh-pages/v\" * version *\n                \"/assets/Manifest.toml\"\nlink_project = \"https://github.com/SciML/\" * name * \".jl/tree/gh-pages/v\" * version *\n               \"/assets/Project.toml\"\nMarkdown.parse(\"\"\"You can also download the\n[manifest]($link_manifest)\nfile and the\n[project]($link_project)\nfile.\n\"\"\")","category":"section"},{"location":"#BaseModelica.parse_basemodelica","page":"Home","title":"BaseModelica.parse_basemodelica","text":"parse_basemodelica(filename::String; parser::Symbol=:julia)::System\n\nParses a BaseModelica .mo file into a ModelingToolkit System.\n\nArguments\n\nfilename::String: Path to the .mo file to parse\nparser::Symbol=:julia: Parser to use. Options:\n:julia - ParserCombinator parser (default)\n:antlr - ANTLR parser\n\nExample\n\n# Use ANTLR parser (default)\nparse_basemodelica(\"testfiles/NewtonCoolingBase.bmo\")\nparse_basemodelica(\"testfiles/NewtonCoolingBase.bmo\", parser=:antlr)\n# Use ParserCombinator parser\nparse_basemodelica(\"testfiles/NewtonCoolingBase.bmo\", parser = :julia)\n\n\n\n\n\n","category":"function"}]
